import React, { Component } from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import { TripList } from './TripList';
import { BucketList } from './BucketList';
import { Navbar, Nav, Container, Image } from 'react-bootstrap';
import logo from '...png';
import Home from './Home';


import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
} from 'react-router-dom';


export default function Navigation() {
    return (
        <div>

            <Router>
                <div>

                <Navbar bg="navbar navbar-expand-lg navbar-light bg-light p-2" variant="light">

                <Container className="">
                <Navbar.Brand href="#home">Logo
                <Image src={logo.png}/>
                </Navbar.Brand>
                <Nav>
                    <Link className="p-3" to="/">Home</Link> 
                    <Link className="p-3" to="/bucketList">BucketList</Link> 
                    <Link className="p-3" to="/trips">trips</Link>
                </Nav>
                </Container>

                </Navbar>

                <Switch>
                    <Route path='/trips'> 
                    <TripList />
                    </Route>

                    <Route path='/bucketList'> 
                    <BucketList />
                    </Route>

                    <Route path="/">
                    <Home />
                    </Route>
                </Switch>
                </div>
            </Router>

        </div>
    );
  }
